import React, { useEffect, useState } from 'react';

const RosterPaymentsPage = () => {
  const [roster, setRoster] = useState([]);

  useEffect(() => {
    fetch('/data/roster.json')
      .then(res => res.json())
      .then(data => setRoster(data))
      .catch(err => {
        console.error('Error loading roster:', err);
        setRoster([]);
      });
  }, []);

  return (
    <div style={{ padding: '20px', maxWidth: '700px', margin: '0 auto' }}>
      <h2 style={{
        fontSize: '24px',
        fontWeight: 'bold',
        marginBottom: '24px',
        textAlign: 'center',
        backgroundColor: '#004225',
        color: 'white',
        padding: '10px 0',
        borderRadius: '8px'
      }}>
        üèà Players Roster
      </h2>

      {roster.length === 0 ? (
        <p>No roster data available.</p>
      ) : (
        <ul style={{ listStyleType: 'none', padding: 0 }}>
          {roster.map((player, idx) => (
            <li key={idx} style={{
              backgroundColor: idx % 2 === 0 ? '#f0f0f0' : '#e6ffe6',
              marginBottom: '10px',
              padding: '12px 16px',
              borderRadius: '6px',
              fontSize: '18px',
              fontWeight: 'bold',
              boxShadow: '1px 1px 3px rgba(0,0,0,0.1)'
            }}>
              üß¢ {player.GameName || 'Unnamed Player'}
            </li>
          ))}
        </ul>
      )}
    </div>
  );
};

export default RosterPaymentsPage;
